          "content": "【#PDD爆料小天心酸史#】住地下室，月工资5000，一度成为Knight赠品PDD说：小天和Knight两个人是一起来到YM的，两个人来的时候都在15，6岁左右，不过Knight在很短的时间内就打到了韩服第一，这在当时来说是很恐怖的事情，结果各大俱乐部纷纷表示对Knight感兴趣，想要买他，而小天则是无人问津，当时Knight来YM第一年签约费就达到300万，而小天只有一个月5000到1万的样子，后来Knight去打LPL之后小天甚至愿意成为赠品\"一起打LPL，然而后来Knight在LPL打得风生水起，小天却没有LPL战队垂青，他就一个人在地下室刻苦训练，最终以很低的价格加盟FPX，但他没有半点怨言。在谈到小天获得FMVP时，骚猪也感慨颇多，他补充说到：小天在1-2年前就像我说的那样惨，然而被评为FMVP之后，他可以说是全球几亿LOL玩家中打得最好的人，这就相当于足球中的\"足球先生\"，是一个很大的荣誉，小天的经历在电竞圈里真的非常励志！正所谓吃得苦中苦，方为人上人，小天的经历也注定是今年秋季电竞圈最励志的故事。#英雄联盟#\"",
