          "author": "微热点",
          "content": "#营销洞察#LV跨界搞事情了？？9月23日，@路易威登?与@拳头游戏?官宣，自2019年起，就@英雄联盟?全球总决赛展开合作。双方携手为代表电竞领域最高荣耀的“召唤师杯”打造了一款独一无二的奖杯旅行硬箱。10月30日，@英雄联盟?放出与路易威登联合为英雄“奇亚娜”设计的联名英雄皮肤展示视频，掀起讨论热潮。热点菌带领大家从传播角度看看这次具有里程碑意义的合作吧。从9月23日至今，全网关于“路易威登跨界携手英雄联盟”的信息量多达144万条。在引起时尚圈和电竞圈话题的同时，@路易威登?邀请品牌挚友@朱一龙?前往巴黎观看英雄联盟s9全球总决赛，引起广大粉丝关注。http://t.cn/RG9KCRA?对朱一龙观赛后发布的微博进行分析，本条微博在传播中共形成12个转发层级，覆盖微博用户6522万人次，微博用户@吴邪的小泥巴_桃桃?带动二次转发50805次，成为关键传播用户，共形成两波转发、评论热潮，微博话题#朱一龙LV英雄联盟#引来2.3亿人次查看，产生97.7万条讨论。对11月1日至14日12时期间“英雄联盟”“路易威登”“朱一龙”三者全网声量进行分析，可看出“朱一龙”声量整体高于其他两项，在10日三者信息量变化趋势大致相同，信息量均成上升态势，且“英雄联盟”声量已反超“路易威登”。此次LV主动打破圈层壁垒，向英雄联盟抛出橄榄枝，并邀请朱一龙来增加话题性，扩大品牌影响力，时尚、电竞与娱乐的碰撞让粉丝们兴奋不已！",
